import React, { Component } from "react";
import "./css-components/login-signup.css";
import { Button } from "reactstrap";

class Login extends Component {
  loginstate = {
    credentials: { username: "", password: "" },
  };

  state = {
    credentials2: {
      username: "",
      password: "",
      location: "",
      phone: "",
      role: "none",
    },
  };

  login = (event) => {
    console.log(this.loginstate.credentials);
    fetch("http://127.0.0.1:8000/auth/", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(this.loginstate.credentials),
    })
      .then((data) => data.json()) //append the token to data
      .then((data) => {
        this.props.userlogin(data.token); //pass the token to app.js
      })
      .catch((error) => console.error(error));
  };

  register = (event) => {
    console.log(this.state.credentials2);
    fetch("http://127.0.0.1:8000/api/users/", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(this.state.credentials2),
    })
      .then((data) => data.json()) //append the token to data
      .then((data) => {
        console.log(data);
      })
      .catch((error) => console.error(error));
  };

  //Set State for event

  //login
  inputChanged = (event) => {
    const cred = this.loginstate.credentials;
    cred[event.target.name] = event.target.value;
    this.setState({ credentials: cred });
  };

  //register
  inputChangedRegister = (event) => {
    const cred = this.state.credentials2;
    cred[event.target.name] = event.target.value;
    this.setState({ credentials2: cred });
  };

  render() {
    return (
      <div className="App">
        <div className="login-home">
          <h1>Login</h1>

          <label>Username</label>
          <br />
          <input
            type="text"
            name="username"
            value={this.loginstate.credentials.username}
            onChange={this.inputChanged}
          />

          <br />

          <label>Password</label>
          <br />
          <input
            type="password"
            name="password"
            value={this.loginstate.credentials.password}
            onChange={this.inputChanged}
            required
          />

          <br />
          <br />

          <Button color="success" onClick={this.login}>
            Login
          </Button>
        </div>

        <div className="register-home">
          <h1>Register</h1>

          <label>Username</label>
          <br />
          <input
            type="text"
            name="username"
            value={this.state.credentials2.username}
            onChange={this.inputChangedRegister}
          />

          <br />
          <label>Phone</label>
          <br />
          <input
            type="text"
            name="phone"
            value={this.state.credentials2.phone}
            onChange={this.inputChangedRegister}
          />

          <br />
          <label>Location</label>
          <br />
          <input
            type="select"
            name="location"
            value={this.state.credentials2.location}
            onChange={this.inputChangedRegister}
          />

          <br />

          <label>Password</label>
          <br />
          <input
            type="password"
            name="password"
            value={this.state.credentials2.password}
            onChange={this.inputChangedRegister}
            required
          />

          <br />
          <br />

          <Button color="info" onClick={this.register}>
            Register
          </Button>
        </div>
      </div>
    );
  }
}

export default Login;
